import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles((theme) => ({
  appBar: {
    paddingLeft: theme.spacing(10),
    paddingRight: theme.spacing(10),
    height:100,
    justifyContent: 'center',
    background: 'transparent',
    boxShadow: 'none'
  },
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    color:'black'
  },
  rightButton: {
    color:'black',
    marginRight: theme.spacing(2),
    marginLeft: theme.spacing(2)
  }
}));

const Nav = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar className={classes.appBar} position="static">
        <Toolbar>
        <Button style={{color:'black',
    marginRight: theme.spacing(2),
    marginLeft: theme.spacing(2),flexGrow: 1 }}><Typography variant="h6" className={classes.title}>
            GreenTech
          </Typography></Button>

          <Button className={classes.rightButton}>Activity 1</Button>
          <Button className={classes.rightButton}>Activity 2</Button>
          <Button className={classes.rightButton}>Activity 3</Button>
          <Button className={classes.rightButton}>Services</Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Nav
